import React from 'react';
import { useDispatch } from 'react-redux';
import User from '../components/User';
import { user_summary, user_projects, user_statistics } from '../modules/user';

const UserContainer = ({ id, page, user }) => {
    const dispatch = useDispatch();

    const userSummary = user => dispatch(user_summary(user));
    const userProjects = user => dispatch(user_projects(user));
    const userStatistics = user => dispatch(user_statistics(user));

    return (
        <User
            id={id}
            page={page}
            user={user}
            userSummary={userSummary}
            userProjects={userProjects}
            userStatistics={userStatistics}
        />
    )
}

export default UserContainer;
